import React from 'react';
import Link from 'next/link';
import Button from '../Button/';

export default class PortfolioLink extends React.Component {
  render(props) {
    return (
      <Link
        as={`/portfolio/${this.props.id}`}
        href={`/post?title=${this.props.title}`}>
        <a>
          <Button classes={this.props.background} text='View Project' />
        </a>
      </Link>
    );
  }
}
